class Solution:    def majorityElement(self, nums):        """        :type nums: List[int]        :rtype: List[int]        """        n=len(nums)        times,ans={},[]        for i in range(n):            if nums[i] not in times:                times[nums[i]]=1            else:                times[nums[i]]+=1        for key,val in times.items():            if val>int(n/3):                ans.append(key)        return ans